import React, { Component } from 'react';
import { BrowserRouter,Routes,Route,Switch,Navigate,Redirect,Link, createBrowserRouter} from 'react-router-dom'
import Home from './Home.js'
import logo from './logo.svg';
import './App.css';


class App extends Component {

  constructor(props) {
    super(props);
    this.state = { apiResponse: "" };
  }

  callAPI() {
      fetch("http://104.128.95.54:9000/testAPI")
          .then(res => res.text())
          .then(res => this.setState({ apiResponse: res }))
          .then(err => err);
  }

  componentDidMount() {
      this.callAPI();
  }

goPage(){
  let history = createBrowserRouter();
  history.push("/Home");
}


  render(){
    if(false)
      return <Redirect to='/Home' />
      return (
        <form  >
          <label className='userName'>User:</label>
          <input type="text" value={this.state.apiResponse} />
          <br/>
          <label className='userPwd'>Pwd :</label>
          <input type="password" value={this.state.apiResponse} />
          <br/>
          <input type="submit" onClick={this.goPage} />
          <Link to='/home'>666</Link>
          <BrowserRouter>
          <button>

          <Routes>
            <Route path='/home' element={<Home/>}></Route>
          </Routes>
          </button>
        </BrowserRouter>

        </form>
      );
  }
}


export default App;
